SELECT TBL_LOGOWANIA_ID_LOGOWANIA_SEQ.NEXTVAL, AGENT_ID, ZDARZENIE +1,  GODZINA_ZDARZENIA  + INTERVAL '8' HOUR FROM TBL_LOGOWANIA;



DECLARE



ag_id tbl_logowania.agent_id%type;
go_zda tbl_logowania.godzina_zdarzenia%type;

cursor c_logowania IS SELECT agent_Id, godzina_zdarzenia into ag_id, go_zda from tbl_logowania where zdarzenie = 1;

ilTick Number;
Datawyj TIMESTAMP;
dataPocz TIMESTAMP;
dataKonc TIMESTAMP;
zakrMinut NUMBER;
randMin NUMBER;
controler NUMBER;


BEGIN

    OPEN c_logowania;
    loop
    
    
        FETCH c_logowania INTO ag_id, go_zda;
        EXIT WHEN c_logowania%NOTFOUND;
        ilTick := floor(dbms_random.value(5, 15));
        dataWyj := go_zda;
         
        
        
            
            
        
        for i In 1..ilTick loop
        
            zakrMinut := 60 / ilTick;
            randMin := (dbms_random.value(5, zakrMinut));
            
            dataPocz := datawyj  + NUMTODSINTERVAL(dbms_random.value(2, 7), 'MINUTE') ;
            dataKonc := dataPocz + NUMTODSINTERVAL(randMin, 'MINUTE') ;
            datawyj := dataKonc;
            
            
         INSERT 
         INTO TBL_ZGLOSZENIA(ZGLOSZENIE_ID, AGENT_ID, CZAS_ROZP_ZGLOSZENIA, CZAS_ZAK_ZGLOSZENIA, STATUS_ZGLOSZENIA , ROZWIAZANE_PRZEZ_AGENTA_PRZYJM) 
         Values (
         TBL_ZGLOSZENIA_ZGLOSZENIE_I88.NEXTVAL, ag_id,dataPocz,dataKonc,floor(dbms_random.value(1, 3)),floor(dbms_random.value(0, 2)));   
        
            commit;
   
        
       
        
        end Loop;
    
    
    
    end loop;
END;
/













CREATE OR REPLACE FUNCTION sp_znajdz (agent_id in number, miesiac in string) RETURN NUMBER
is liczbaZgloszen NUMBER;
BEGIN
    

    SELECT COUNT(*) INTO liczbaZgloszen FROM TBL_ZGLOSZENIA WHERE AGENT_ID = 3 AND to_char(czas_rozp_zgloszenia, 'yyyy-mm') = miesiac;
    Return liczbazgloszen;
END sp_znajdz;
/


CREATE OR REPLACE FUNCTION licz_skutecznosc (identyfikator in number, miesiac in string) RETURN NUMBER IS
   
skutecznosc number;
rozwiazane number;
nierozwiazane number;

BEGIN
select count(*) into rozwiazane from tbl_zgloszenia 
where rozwiazane_przez_agenta_przyjm = 1
and agent_id = identyfikator and TO_CHAR(czas_rozp_zgloszenia, 'YYYY-MM') = miesiac;

select count(*) into nierozwiazane from tbl_zgloszenia 
WHERE agent_id = identyfikator and TO_CHAR(czas_rozp_zgloszenia, 'YYYY-MM') = miesiac;

skutecznosc := rozwiazane / nierozwiazane;

RETURN skutecznosc;

END licz_skutecznosc;
/




create or replace PROCEDURE ewaluuj2018 AS

k_agent_id tbl_agenci.agent_id%type;
cursor agent_id_cur IS
Select agent_id into k_agent_id from tbl_agenci order by agent_id;

liczba_agentow number;
miesiactxt varchar(12);
miesiac date;
miekal varchar(7);

BEGIN


    open agent_id_cur;

   loop
        FETCH agent_id_cur INTO k_agent_id;
        exit when agent_id_cur%NOTFOUND;

        for j in 1..12 loop

            miesiactxt := '2018-'||j||'-01';
            miesiac := to_date(miesiactxt, 'yyyy-dd-mm');
            miekal := to_char(miesiac, 'yyyy-mm');

           values (TBL_EWALUACJE_EWALUACJA_ID_SEQ.nextval,1, k_agent_id , licz_skutecznosc(k_agent_id, miekal), miesiac);
        end loop;



    end loop;



END;
/
